import styled from 'styled-components';

export const Button = styled.button`
  display: block;
  font-size: 10px;
  color: white;
  width: 100%;
  height: 30px;
  padding: 0 8px;
  border: none;
  outline: none;
  appearance: none;
  background-image: none;
  background-color: black;
  box-shadow: none;
  cursor: pointer;
`;
